import React from 'react';
import PropTypes from 'prop-types';
import ListItem from '@material-ui/core/ListItem';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemSecondaryAction from '@material-ui/core/ListItemSecondaryAction';
import ListItemText from '@material-ui/core/ListItemText';
import IconButton from '@material-ui/core/IconButton';
import EditIcon from '@material-ui/icons/Edit';

import Whiskas from '../../../images/whiskas.jpg';
import Zeep from '../../../images/zeep.jpg';
import Strokorrel from '../../../images/strokorrel.png';
import Vogel from '../../../images/vogel.png';
import { Typography } from '@material-ui/core';
import TableCell from '@material-ui/core/TableCell';

import Divider from '@material-ui/core/Divider';

import './BasicListItem.css';

const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: 752,
    marginLeft: '5ch',
    marginRight: '5ch'
  },
  demo: {
    backgroundColor: theme.palette.background.paper,
  },
  title: {
    margin: theme.spacing(4, 0, 2),
  },
  listitem: {
      marginBottom: '0.5ch',
      marginTop: '0.5ch',
      borderBottomColor: 'grey',
        borderBottomWidth: 2
  },
  listItemText:{
    paddingLeft: '2ch',
  },
  cell1: {
      width: '400px',
      fontSize: 23,
      borderBottom: 'none',
      bottom: '0'
  },
  cell2: {
    width:'120px',
    fontSize: 23,
    borderBottom: 'none'
  },
  delete: {
    backgroundColor: "red",
  }
}));

const classes = useStyles();

const BasicListItem = () => (
  <div className="basic-swipeable-list__item">
    <ListItem className={classes.listitem}>
      <ListItemAvatar >
          <img src={Zeep} alt="not found" width="60" height="60"/>
      </ListItemAvatar>
      <ListItemText className={classes.listItemText}>
        <Typography variant="h5">
                <TableCell className={classes.cell1}>Aloe Vera Zeep</TableCell>
                <TableCell className={classes.cell2}>14 st</TableCell>
        </Typography>

      </ListItemText>
      <ListItemSecondaryAction>
        <IconButton edge="end" aria-label="edit">
          <EditIcon fontSize="large"/>
        </IconButton>
      </ListItemSecondaryAction>
    </ListItem>
    <Divider />
  </div>
);

BasicListItem.propTypes = {
  label: PropTypes.string
};

export default BasicListItem;
